import React, {Component} from 'react';
import poop from '../mock-data/students.json';

class Grid extends Component {
    render() {
        const gridStyle = {
            background: '#eee',
            margin: '0 0 0 300px',
            width: '100px',
            border: '1px solid black',
            padding: '1em',
            display: 'block'
        }

        return (
            <div className = 'Grid' style={gridStyle}>
                <div>
                    {poop.map((studentItem, index)=>{
                        return <p key={studentItem.id}>{studentItem.id}</p>
                    })}
                </div>
                <div>
                    {poop.filter(function(student, n) {
                        return <p>{student.id === "1"}</p>
                    })}
                </div>
            </div>
        )
            }
}
export default Grid;
